import React from 'react'
import {IoIosSearch} from "react-icons/io";
const Searchbar = () => {

    return (
        <header>
            <input style = {Inputbar} placeholder="Search"/>
                <select style = {Categorybar} name="Cat" placeholder="Ca">
                <option>Categories</option>
                </select>
                <div style={{flex:1, flexDirection:'column'}}>
                <span style={{backgroundColor:'green', height:'4px', width:'4rem', padding:'.01rem'}}>
                <IoIosSearch style= {Searchicon}/>
                </span>
                </div>
        </header>
    )
}
 
const Inputbar = {
    height: '2rem',
    width: '20rem',
    textAlign: 'center',
    borderBottomColor: 'yellow',
    borderWidth: 'thin thin .2rem thin'
}
const Categorybar = {
    height: '2.4rem',
    width: '10rem',
    borderBottomColor: 'green',
    borderWidth: 'thin thin .2rem thin'
}
const Searchicon = {
    width:'2rem',
    paddingTop:'3rem'
}
export default Searchbar
